import { Component } from '@angular/core';

@Component({
  selector: 'app-wishlist',
  templateUrl: './wishlist.component.html',
  styleUrls: ['./wishlist.component.scss']
})
export class WishlistComponent {
  constructor(private wishlistService: WishlistService) { }

  ngOnInit(): void {
    this.createWishlist();
    this.addGameToWishlist(1, 2); // Exemplu de apelare a metodei
  }

  createWishlist(): void {
    this.wishlistService.createWishlist().subscribe((wishlist: Wishlist) => {
      console.log('Wishlist created:', wishlist);
    });
  }

  addGameToWishlist(wishlistId: number, gameId: number): void {
    this.wishlistService.addGameToWishlist(wishlistId, gameId).subscribe((wishlist: Wishlist) => {
      console.log('Game added to wishlist:', wishlist);
    }, error => {
      console.error('Error adding game to wishlist:', error);
    });
  }

}
